import React, {Component} from 'react';
import {Link} from 'react-router-dom';

import '../../App.css';
import SlideShow from './SlideShow';

import img1 from '../assets/img/slider/1.jpg';
import img2 from '../assets/img/slider/2.jpg';
import img3 from '../assets/img/slider/2.jpg';
import img4 from '../assets/img/slider/2.jpg';
import img5 from '../assets/img/slider/2.jpg';


const collections = [
    {src: img1,caption: ""},
    {src: img2,caption: ""},
    {src: img3,caption: ""},
    {src: img4,caption: ""},
    {src: img5,caption: ""}
];

class Header extends Component {
    render(){
        return(
            <div className="slider-header">
                <SlideShow 
                    input={collections}
                    ratio={`3:2`}
                    mode={`automatic`}
                    timeout={`3000`}
                />
            </div>
        );
    }
}

export default Header;
